    true,nt"url": null,nt"notes": "<p>The NIS is the largest publicly available
    all-payer inpatient care database in the United States. It contains data from approximately
    8 million hospital stays each year. Restricted access data files are available with
    a data use agreement and brief online security training.<br />n The 2012 NIS was
    redesigned.  The new NIS is a sample of discharges from all hospitals participating
    in HCUP.  For prior years, the NIS was a sample of hospitals.  The NIS allows for
    weighted national estimates to identify, track, and analyze national trends in health
    care utilization, access, charges, quality, and outcomes.</p>n<p>The NIS is drawn
    from States participating in HCUP. NIS data are available since 1988, allowing analysis
    of trends over time.</p>n<p>The NIS includes charge information for all patients,
    regardless of payer, including persons covered by Medicare, Medicaid, private insurance,
    and the uninsured.</p>n<p>The NIS's large sample size enables analyses of rare conditions,
    such as congenital anomalies; uncommon treatments, such as organ transplantation;
    and special patient populations, such as the uninsured.</p>n<p>The NIS contains
    clinical and resource use information included in a typical discharge abstract,
    with safeguards to protect the privacy of individual patients, physicians, and hospitals
    (as required by data sources). The NIS excludes data elements that could directly
    or indirectly identify individuals.</p>n",nt"license_title": "Other License
